DROP TABLE IF EXISTS `audit_borrowers`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `audit_borrowers` (
  `audit_key` int(11) DEFAULT NULL COMMENT 'NOSHOW',
  `audit_subkey` int(11) NOT NULL AUTO_INCREMENT COMMENT 'NOSHOW',
  `audit_action` varchar(45) DEFAULT NULL,
  `audit_when` varchar(45) DEFAULT NULL,
  `borrower_id` int(11) DEFAULT NULL COMMENT 'NOSHOW',
  `user_id` int(11) DEFAULT NULL COMMENT 'NOSHOW',
  `business_name` varchar(60) DEFAULT NULL COMMENT 'Business Name',
  `business_organisation` varchar(100) DEFAULT NULL COMMENT 'Business Organisation',
  `bo_id` int(11) DEFAULT NULL COMMENT 'NOSHOW',
  `industry` varchar(50) DEFAULT NULL COMMENT 'Industry',
  `date_of_incorporation` date DEFAULT NULL COMMENT 'Date of Incorporation',
  `business_registration_number` varchar(100) DEFAULT NULL COMMENT 'Registration num',
  `contact_person` varchar(100) DEFAULT NULL COMMENT 'Contact Person',
  `contact_person_email` varchar(255) DEFAULT NULL COMMENT 'Contact Email',
  `contact_person_mobile` varchar(45) DEFAULT NULL COMMENT 'Mobile Number',
  `paid_up_capital` decimal(20,8) DEFAULT NULL COMMENT 'Paid-up Capital',
  `paid_up_capital_currency` varchar(4) DEFAULT NULL COMMENT 'NOSHOW',
  `number_of_employees` int(11) DEFAULT NULL COMMENT 'Num of Employees',
  `operation_since` date DEFAULT NULL COMMENT 'Operation Since',
  `risk_industry` varchar(2000) DEFAULT NULL COMMENT 'Risk Industry',
  `risk_strength` varchar(2000) DEFAULT NULL COMMENT 'Risk Strength',
  `risk_weakness` varchar(2000) DEFAULT NULL COMMENT 'Risk Weakness',
  `borrower_risk_grade` varchar(1) DEFAULT NULL COMMENT 'Risk Grade',
  `registered_address` varchar(1000) DEFAULT NULL COMMENT 'Registered Address',
  `mailing_address` varchar(1000) DEFAULT NULL COMMENT 'Mailing Address',
  `company_profile` varchar(2000) DEFAULT NULL COMMENT 'Company Profile',
  `company_aboutus` varchar(2000) DEFAULT NULL COMMENT 'About Us',
  `oAuthType` varchar(45) DEFAULT NULL COMMENT 'NOSHOW',
  `oAuth_login_id` varchar(255) DEFAULT NULL COMMENT 'NOSHOW',
  `comments` longtext COMMENT 'Comments',
  `status` int(11) DEFAULT NULL COMMENT 'Status',
  `company_image` varchar(255) DEFAULT NULL COMMENT 'Image URL',
  `company_image_thumbnail` varchar(255) DEFAULT NULL COMMENT 'NOSHOW',
  `company_video_url` varchar(255) DEFAULT NULL COMMENT 'NOSHOW',
  `register_datetime` datetime DEFAULT NULL COMMENT 'NOSHOW',
  `approval_datetime` datetime DEFAULT NULL COMMENT 'NOSHOW',
  `acra_profile_doc_url` varchar(255) DEFAULT NULL,
  `moa_doc_url` varchar(255) DEFAULT NULL,
  `financial_doc_url` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`audit_subkey`)
) ENGINE=InnoDB AUTO_INCREMENT=75 DEFAULT CHARSET=latin1;
