  `fees_type_applicable` int(11) DEFAULT NULL COMMENT 'Fee Type Applicable',
  `penalty_interest` decimal(6,2) DEFAULT NULL COMMENT 'Overdue Penalty Interest (%)',
  `penalty_fee_minimum` decimal(20,8) DEFAULT NULL COMMENT 'Overdue Process Fees Minimum',
  `penalty_fee_percent` decimal(6,2) DEFAULT NULL COMMENT 'Overdue Process fees (%)',
  `borrower_signup_subject` varchar(255) DEFAULT NULL COMMENT 'Mail Subject - Borrower Signup',
  `investor_signup_subject` varchar(255) DEFAULT NULL COMMENT 'Mail Subject - Investor Signup',
  `borrower_approval_subject` varchar(255) DEFAULT NULL COMMENT 'Mail Subject - Borrower Approval',
  `investor_approval_subject` varchar(255) DEFAULT NULL COMMENT 'Mail Subject - Investor Approval',
  `borrower_profile_comments_subject` varchar(255) DEFAULT NULL COMMENT 'Mail Subject - Borr. Prof. Comments',
  `investor_profile_comments_subject` varchar(255) DEFAULT NULL COMMENT 'Mail Subject - Inv. Prof. Comments',
  `borrower_loan_comments_subject` varchar(255) DEFAULT NULL COMMENT 'Mail Subject - Borr. Loan Comments',
  `borrower_loan_cancel_subject` varchar(255) DEFAULT NULL COMMENT 'Mail Subject - Borr. Loan Cancel',
  `borrower_loan_approval_subject` varchar(255) DEFAULT NULL COMMENT 'Mail Subject - Borr. Loan Approval',
  `borrower_transaction_complete_subject` varchar(255) DEFAULT NULL COMMENT 'Mail Subject - Borr. Trans. Complete',
  `investor_transaction_complete_subject` varchar(255) DEFAULT NULL COMMENT 'Mail Subject - Inv. Trans. Complete',
  `borrower_signup_content` longtext COMMENT 'Mail Content - Borr. Signup',
  `investor_signup_content` longtext COMMENT 'Mail Content - Inv. Signup',
  `borrower_approval_content` longtext COMMENT 'Mail Content - Borr. Approval',
  `investor_approval_content` longtext COMMENT 'Mail Content - Inv. Approval',
  `borrower_profile_comments_content` longtext COMMENT 'Mail Content - Borr. Prof. Comments',
  `investor_profile_comments_content` longtext COMMENT 'Mail Content - Inv. Prof. Comments',
  `borrower_loan_comments_content` longtext COMMENT 'Mail Content - Borr. Loan Comments',
  `borrower_loan_cancel_content` longtext COMMENT 'Mail Content - Borr. Loan Cancel',
  `borrower_loan_approval_content` longtext COMMENT 'Mail Content - Borr. Loan Approval',
  `borrower_transaction_complete_content` longtext COMMENT 'Mail Content - Borr. Trans. Complete',
  `investor_transaction_complete_content` longtext COMMENT 'Mail Content - Inv. Trans. Complete',
  PRIMARY KEY (`audit_subkey`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
